Our linen bedding set is not just soft. It’s the kind of soft that feels like wrapping yourself in a best friend’s hug after a long day. Here at SOUTH, we don't do shortcuts. We are crazy about effortless luxury, comfort, sustainability, and quality. That means we use only top-notch CERTIFIED 100% organic, enzyme-washed flax fabric that won't shrink and will become an heirloom piece at your home - the more you use it, the more fabulous, soft, and YOURS it will become!

WHY OUR LINEN IS SO AMAZING?
Linen is a very durable, strong fabric that has antibacterial, antistatic, and hygroscopic properties. Also due to its natural qualities, linen is comfortable in all seasons as it keeps you cool when it is hot and warm when it is cold. Also, we use only the highest quality linen directly from Lithuanian flax mills, which means it's very durable and you will use it for many many years.

READY AS A GIFT
A linen bedding set with pillows can be the perfect gift for your beloved one! Just let us know and we will pack it as a gift! Personalised Gift messages are available on our branded card.randed card.

DETAILS:
- Includes one duvet cover + 2 pillowcases;
- Composition: 100% linen;
- Color: Green;
- Duvet cover closure type - buttons.- Pillowcase closure type - envelope (please contact us if you want to have pillows with button closure)
- Hypoallergenic, thermoregulating, breathable.
- Ethically made in Lithuania;
- Write in the comments if you need to attach ties to the corners of your duvet cover.
